acrobatics.basePowerCallback:
basePowerCallback(pokemon, target, move) {
            if (!pokemon.item) {
                this.debug("BP doubled for no item");
                return move.basePower * 2;
            }
            return move.basePower;
        }

acupressure.onHit:
onHit(target) {
            const stats = [];
            let stat;
            for (stat in target.boosts) {
                if (target.boosts[stat] < 6) {
                    stats.push(stat);
                }
            }
            if (stats.length) {
                const randomStat = this.sample(stats);
                const boost = {};
                boost[randomStat] = 2;
                this.boost(boost);
            }
            else {
                return false;
            }
        }

afteryou.onHit:
onHit(target) {
            if (this.activePerHalf === 1)
                return false; // fails in singles
            const action = this.queue.willMove(target);
            if (action) {
                this.queue.prioritizeAction(action);
                this.add('-activate', target, 'move: After You');
            }
            else {
                return false;
            }
        }

secondary.onHit:
onHit(target, source, move) {
                if (target?.statsRaisedThisTurn) {
                    target.addVolatile('confusion', source, move);
                }
            }

allyswitch.onHit:
onHit(pokemon) {
            let success = true;
            // Fail in formats where you don't control allies
            if (this.format.gameType !== 'doubles' && this.format.gameType !== 'triples')
                success = false;
            // Fail in triples if the Pokemon is in the middle
            if (pokemon.side.active.length === 3 && pokemon.position === 1)
                success = false;
            const newPosition = (pokemon.position === 0 ? pokemon.side.active.length - 1 : 0);
            if (!pokemon.side.active[newPosition])
                success = false;
            if (pokemon.side.active[newPosition].fainted)
                success = false;
            if (!success) {
                this.add('-fail', pokemon, 'move: Ally Switch');
                this.attrLastMove('[still]');
                return this.NOT_FAIL;
            }
            this.swapPosition(pokemon, newPosition, '[from] move: Ally Switch');
        }

condition.onRestart:
onRestart(pokemon) {
                // this.effectState.counter should never be undefined here.
                // However, just in case, use 1 if it is undefined.
                const counter = this.effectState.counter || 1;
                this.debug(`Ally Switch success chance: ${Math.round(100 / counter)}%`);
                const success = this.randomChance(1, counter);
                if (!success) {
                    delete pokemon.volatiles['allyswitch'];
                    return false;
                }
                if (this.effectState.counter < this.effect.counterMax) {
                    this.effectState.counter *= 3;
                }
                this.effectState.duration = 2;
            }

secondary.onHit:
onHit(target, source, move) {
                if (source.isActive)
                    target.addVolatile('trapped', source, move, 'trapper');
            }

aromatherapy.onHit:
onHit(target, source, move) {
            this.add('-activate', source, 'move: Aromatherapy');
            let success = false;
            const allies = [...target.side.pokemon, ...target.side.allySide?.pokemon || []];
            for (const ally of allies) {
                if (ally !== source && !this.suppressingAbility(ally)) {
                    if (ally.hasAbility('sapsipper')) {
                        this.add('-immune', ally, '[from] ability: Sap Sipper');
                        continue;
                    }
                    if (ally.hasAbility('goodasgold')) {
                        this.add('-immune', ally, '[from] ability: Good as Gold');
                        continue;
                    }
                    if (ally.volatiles['substitute'] && !move.infiltrates)
                        continue;
                }
                if (ally.cureStatus())
                    success = true;
            }
            return success;
        }

assist.onHit:
onHit(target) {
            const moves = [];
            for (const pokemon of target.side.pokemon) {
                if (pokemon === target)
                    continue;
                for (const moveSlot of pokemon.moveSlots) {
                    const moveid = moveSlot.id;
                    const move = this.dex.moves.get(moveid);
                    if (move.flags['noassist'] || move.isZ || move.isMax) {
                        continue;
                    }
                    moves.push(moveid);
                }
            }
            let randomMove = '';
            if (moves.length)
                randomMove = this.sample(moves);
            if (!randomMove) {
                return false;
            }
            this.actions.useMove(randomMove, target);
        }

assurance.basePowerCallback:
basePowerCallback(pokemon, target, move) {
            if (target.hurtThisTurn) {
                this.debug('BP doubled on damaged target');
                return move.basePower * 2;
            }
            return move.basePower;
        }

condition.onStart:
onStart(pokemon, source, effect) {
                if (!(pokemon.gender === 'M' && source.gender === 'F') && !(pokemon.gender === 'F' && source.gender === 'M')) {
                    this.debug('incompatible gender');
                    return false;
                }
                if (!this.runEvent('Attract', pokemon, source)) {
                    this.debug('Attract event failed');
                    return false;
                }
                if (effect.name === 'Cute Charm') {
                    this.add('-start', pokemon, 'Attract', '[from] ability: Cute Charm', `[of] ${source}`);
                }
                else if (effect.name === 'Destiny Knot') {
                    this.add('-start', pokemon, 'Attract', '[from] item: Destiny Knot', `[of] ${source}`);
                }
                else {
                    this.add('-start', pokemon, 'Attract');
                }
            }

