                const curDef = target.boosts.def;
                const curSpD = target.boosts.spd;
                this.boost({ def: 1, spd: 1 }, target, target);
                if (curDef !== target.boosts.def)
                    this.effectState.def--;
                if (curSpD !== target.boosts.spd)
