trumpcard.basePowerCallback:
basePowerCallback(source, target, move) {
            const callerMoveId = move.sourceEffect || move.id;
            const moveSlot = callerMoveId === 'instruct' ? source.getMoveData(move.id) : source.getMoveData(callerMoveId);
            let bp;
            if (!moveSlot) {
                bp = 40;
            }
            else {
                switch (moveSlot.pp) {
                    case 0:
                        bp = 200;
                        break;
                    case 1:
                        bp = 80;
                        break;
                    case 2:
                        bp = 60;
                        break;
                    case 3:
                        bp = 50;
                        break;
                    default:
                        bp = 40;
                        break;
                }
            }
            this.debug(`BP: ${bp}`);
            return bp;
        }

upperhand.onTry:
onTry(source, target) {
            const action = this.queue.willMove(target);
            const move = action?.choice === 'move' ? action.move : null;
            if (!move || move.priority <= 0.1 || move.category === 'Status') {
                return false;
            }
        }

uproar.onTryHit:
onTryHit(target) {
            const activeTeam = target.side.activeTeam();
            const foeActiveTeam = target.side.foe.activeTeam();
            for (const [i, allyActive] of activeTeam.entries()) {
                if (allyActive && allyActive.status === 'slp')
                    allyActive.cureStatus();
                const foeActive = foeActiveTeam[i];
                if (foeActive && foeActive.status === 'slp')
                    foeActive.cureStatus();
            }
        }

condition.onResidual:
onResidual(target) {
                if (target.volatiles['throatchop']) {
                    target.removeVolatile('uproar');
                    return;
                }
                if (target.lastMove && target.lastMove.id === 'struggle') {
                    // don't lock
                    delete target.volatiles['uproar'];
                }
                this.add('-start', target, 'Uproar', '[upkeep]');
            }

condition.onAnySetStatus:
onAnySetStatus(status, pokemon) {
                if (status.id === 'slp') {
                    if (pokemon === this.effectState.target) {
                        this.add('-fail', pokemon, 'slp', '[from] Uproar', '[msg]');
                    }
                    else {
                        this.add('-fail', pokemon, 'slp', '[from] Uproar');
                    }
                    return null;
                }
            }

veeveevolley.basePowerCallback:
basePowerCallback(pokemon) {
            const bp = Math.floor((pokemon.happiness * 10) / 25) || 1;
            this.debug(`BP: ${bp}`);
            return bp;
        }

venomdrench.onHit:
onHit(target, source, move) {
            if (target.status === 'psn' || target.status === 'tox') {
                return !!this.boost({ atk: -1, spa: -1, spe: -1 }, target, source, move);
            }
            return false;
        }

venoshock.onBasePower:
onBasePower(basePower, pokemon, target) {
            if (target.status === 'psn' || target.status === 'tox') {
                return this.chainModify(2);
            }
        }

wakeupslap.basePowerCallback:
basePowerCallback(pokemon, target, move) {
            if (target.status === 'slp' || target.hasAbility('comatose')) {
                this.debug('BP doubled on sleeping target');
                return move.basePower * 2;
            }
            return move.basePower;
        }

waterpledge.basePowerCallback:
basePowerCallback(target, source, move) {
            if (['firepledge', 'grasspledge'].includes(move.sourceEffect)) {
                this.add('-combine');
                return 150;
            }
            return move.basePower;
        }

waterpledge.onPrepareHit:
onPrepareHit(target, source, move) {
            for (const action of this.queue) {
                if (action.choice !== 'move')
                    continue;
                const otherMove = action.move;
                const otherMoveUser = action.pokemon;
                if (!otherMove || !action.pokemon || !otherMoveUser.isActive ||
                    otherMoveUser.fainted || action.maxMove || action.zmove) {
                    continue;
                }
                if (otherMoveUser.isAlly(source) && ['firepledge', 'grasspledge'].includes(otherMove.id)) {
                    this.queue.prioritizeAction(action, move);
                    this.add('-waiting', source, otherMoveUser);
                    return null;
                }
            }
        }

waterpledge.onModifyMove:
onModifyMove(move) {
            if (move.sourceEffect === 'grasspledge') {
                move.type = 'Grass';
                move.forceSTAB = true;
                move.sideCondition = 'grasspledge';
            }
            if (move.sourceEffect === 'firepledge') {
                move.type = 'Water';
                move.forceSTAB = true;
                move.self = { sideCondition: 'waterpledge' };
            }
        }

condition.onModifyMove:
onModifyMove(move, pokemon) {
                if (move.secondaries && move.id !== 'secretpower') {
                    this.debug('doubling secondary chance');
                    for (const secondary of move.secondaries) {
                        if (pokemon.hasAbility('serenegrace') && secondary.volatileStatus === 'flinch')
                            continue;
                        if (secondary.chance)
                            secondary.chance *= 2;
                    }
                    if (move.self?.chance)
                        move.self.chance *= 2;
                }
            }

watershuriken.basePowerCallback:
basePowerCallback(pokemon, target, move) {
            if (pokemon.species.name === 'Greninja-Ash' && pokemon.hasAbility('battlebond') &&
                !pokemon.transformed) {
                return move.basePower + 5;
            }
            return move.basePower;
        }

condition.onBasePower:
onBasePower(basePower, attacker, defender, move) {
                if (move.type === 'Fire') {
                    this.debug('water sport weaken');
                    return this.chainModify([1352, 4096]);
                }
            }

waterspout.basePowerCallback:
basePowerCallback(pokemon, target, move) {
            const bp = move.basePower * pokemon.hp / pokemon.maxhp;
            this.debug(`BP: ${bp}`);
            return bp;
        }

weatherball.onModifyType:
onModifyType(move, pokemon) {
            switch (pokemon.effectiveWeather()) {
                case 'sunnyday':
                case 'desolateland':
                    move.type = 'Fire';
                    break;
                case 'raindance':
                case 'primordialsea':
                    move.type = 'Water';
                    break;
                case 'sandstorm':
                    move.type = 'Rock';
                    break;
                case 'hail':
                case 'snowscape':
                    move.type = 'Ice';
                    break;
            }
        }

weatherball.onModifyMove:
onModifyMove(move, pokemon) {
            switch (pokemon.effectiveWeather()) {
                case 'sunnyday':
                case 'desolateland':
                    move.basePower *= 2;
                    break;
                case 'raindance':
                case 'primordialsea':
                    move.basePower *= 2;
                    break;
                case 'sandstorm':
                    move.basePower *= 2;
                    break;
                case 'hail':
                case 'snowscape':
                    move.basePower *= 2;
                    break;
            }
            this.debug(`BP: ${move.basePower}`);
        }

condition.onTryHit:
onTryHit(target, source, move) {
                // Wide Guard blocks all spread moves
                if (move?.target !== 'allAdjacent' && move.target !== 'allAdjacentFoes') {
                    return;
                }
                if (move.isZ || move.isMax) {
                    if (['gmaxoneblow', 'gmaxrapidflow'].includes(move.id))
                        return;
                    target.getMoveHitData(move).zBrokeProtect = true;
                    return;
                }
                this.add('-activate', target, 'move: Wide Guard');
                const lockedmove = source.getVolatile('lockedmove');
                if (lockedmove) {
                    // Outrage counter is reset
                    if (source.volatiles['lockedmove'].duration === 2) {
                        delete source.volatiles['lockedmove'];
                    }
                }
                return this.NOT_FAIL;
            }

wildboltstorm.onModifyMove:
onModifyMove(move, pokemon, target) {
            if (target && ['raindance', 'primordialsea'].includes(target.effectiveWeather())) {
                move.accuracy = true;
            }
        }

condition.onStart:
onStart(pokemon, source) {
                this.effectState.hp = source.maxhp / 2;
                this.effectState.startingTurn = this.getOverflowedTurnCount();
                if (this.effectState.startingTurn === 255) {
                    this.hint(`In Gen 8+, Wish will never resolve when used on the ${this.turn}th turn.`);
                }
            }

condition.onEnd:
onEnd(target) {
                if (target && !target.fainted) {
                    const damage = this.heal(this.effectState.hp, target, target);
                    if (damage) {
                        this.add('-heal', target, target.getHealth, '[from] move: Wish', '[wisher] ' + this.effectState.source.name);
                    }
                }
            }

condition.durationCallback:
durationCallback(source, effect) {
